import styles from './AccentImage.module.css'
import React from 'react';

export default function AccentImage() {
    return (
            <div className={`${styles.ks_accent_img} ${styles.circle}`}>
                <img src={'/Kytra_00.png'} className={styles.med_img} alt={'Image showing a likeness of Kytra.'}/>
            </div>
    )
}
